import React from 'react';
import {Row, Col, Container, Card, ListGroup, Button, Image} from 'react-bootstrap';
import './sidebar.css';
import '../../custom.scss';

import BookStack from "../../resources/icons/BookStack.png";

function New(event){
        if(event.keyCode == 13){
           alert('Adding....');
        }
    }

function Example() {
  return (
        <Container fluid>
        
            <Row className='base'>
                <SideCard/>
                <Col>
                    <Row  className="main-space">
                        <Col className='main-header'>XM Studio | Feed</Col>
                        <Col className='main-content'>'Elllllooo there mateyss!</Col>
                    </Row>
                </Col>
            </Row>
            
        </Container>
    )
}

function SideCard(){
    return(
        <Card className="main-sidebar">
            <Button className="sidebar-button" variant="sidebarbutton"><Image src={BookStack}/></Button>
            <Button className="sidebar-button" variant="sidebarbutton"><Image src={BookStack}/></Button>
            <Button className="sidebar-button" variant="sidebarbutton"><Image src={BookStack}/></Button>
            <Button className="sidebar-button" variant="sidebarbutton"><Image src={BookStack}/></Button>
            <Button className="sidebar-button" variant="sidebarbutton"><Image src={BookStack}/></Button>

        </Card>
    )
}

export default Example;
